Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    import spark.implicits._

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext
      .parallelize(List(("query1", 1614345600), ("query2", 1614345660), ("query1", 1614345720), ("query3", 1614345780)))
      .map(row => (row(0).asInstanceOf[String], row(1).asInstanceOf[Long]))

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext
      .parallelize(List("query1", "query2"))

    // Broadcast top frequent queries
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Calculate hit rate
    val hitRate = calculateHitRate(onsiteData, broadcastTopQueries)

    println(s"Hit rate: $hitRate")

    spark.stop()
  }

  def calculateHitRate(onsiteData: JavaRDD[(String, Long)], broadcastTopQueries: Broadcast[Array[String]]): Double = {
    val cache = mutable.Map[String, (Long, Boolean)]()
    val cacheMisses = ListBuffer[String]()

    onsiteData.foreach { case (query, timestamp) =>
      if (broadcastTopQueries.value.contains(query)) {
        if (!cache.contains(query) || (timestamp - cache(query)._1) > 12 * 60 * 60) {
          cacheMisses += query
          cache.put(query, (timestamp, true))
        } else {
          cache.put(query, (timestamp, false))
        }
      }
    }

    val totalQueries = onsiteData.count()
    val cacheHits = totalQueries - cacheMisses.size

    cacheHits.toDouble / totalQueries.toDouble
  }
}
```
This job first loads the onsite attributed data and top frequent queries into `JavaRDD`s. It then broadcasts the top frequent queries to all executors using `Broadcast`.

The `calculateHitRate` function takes the onsite attributed data and the broadcasted top frequent queries as input. It initializes an empty cache and a list to store cache misses.

For each record in the onsite attributed data, if the query is present in the top frequent queries and it's the first time the query is seen or the query has been cached for more than 12 hours, it's considered a cache miss. The query is then added to the cache and the cache misses list. If the query is already in the cache and has not expired, it's considered a cache hit.

Finally, the function calculates the hit rate by dividing the number of cache hits by the total number of queries.

