Here's an example of how you might write the `onSubmit` function for a form using React and Apollo Client for GraphQL:
```javascript
import React from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations';

function MyForm() {
  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData(event.target);
    const variables = Object.fromEntries(formData);

    try {
      const response = await addData({ variables });
      console.log('Data added successfully:', response);
    } catch (error) {
      console.error('Error adding data:', error);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      {/* Your form fields go here */}
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
```
In this example, we're using the `useMutation` hook from Apollo Client to execute a GraphQL mutation. The `ADD_DATA` mutation is imported from a separate file, which might look something like this:
```javascript
import { gql } from '@apollo/client';

export const ADD_DATA = gql`
  mutation AddData($input: AddDataInput!) {
    addData(input: $input) {
      id
      field1
      field2
      field3
    }
  }
`;
```
The `onSubmit` function is called when the form is submitted. It prevents the default form submission behavior, extracts the form data into an object, and then calls the `addData` function with the form data as variables. If the mutation is successful, the response is logged to the console. If there's an error, it's caught and logged to the console as well.

