Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
A static variable is a variable that has been allocated statically, i.e., at compile time. It retains its value between function calls and is initialized only once. Static variables are declared using the keyword "static".

Here are some properties of static variables:

* They are initialized only once, at the time of their declaration.
* They retain their value between function calls.
* They have a default value of zero if not explicitly initialized.
* They have a scope that is limited to the function in which they are declared.
* They are stored in the data segment of the program's memory.

Example:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
Output:
```
Count: 1
Count: 2
Count: 3
```
In this example, the variable "count" is declared as static inside the function "increment". It is initialized to zero only once, and its value is retained between function calls.

